<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <title>Breakout WebGL</title>
    <style>
        .game_container {
            position: relative;
            width: 376px;
            height: 580px;
        }
        .game_container>canvas {
            display: block;
            position: absolute;
            left: 0;
            top: 0;
        }
        .game_container>canvas#gameCanvas{
            border: 1px solid #cbcbcb;
        }

        /* == dev == */
        body,html{width: 100%;height: 100%;overflow: hidden;}
        .flex{display: flex;flex-direction: column;align-items: center;justify-content: center;flex-wrap: wrap;}
        .controls{flex-direction: row;margin-top: 12px;}
        .controls>p{flex-basis: 100%;text-align: center;margin: 0;padding-bottom: 4px;font-size: 16px;}
        .controls>button{margin: 0 10px;padding: 5px 10px;cursor: pointer;background: none;}
    </style>
</head>

<body class="flex">
    <div class="game_container">
        <canvas id="gameCanvas" width="376" height="580"></canvas>
        <canvas id="overlay" width="376" height="580"></canvas>
    </div>
    <div class="flex controls">
        <p>Dev part</p>
        <button onclick="start()">Start/Stop</button>
